function check_element(e){var t=100/document.getElementsByTagName("div").length;if($(e).on()){var n=t+Number(document.getElementById("progress_width").value);document.getElementById("progress_width").value=n,$("#bar").animate({width:n+"%"},28,(function(){"100%"==document.getElementById("bar").style.width&&($(".preloader").addClass("done"),$(".cover").addClass("active"))}))}else set_ele(e)}function set_ele(e){check_element(e)}document.onreadystatechange=function(e){for(var t=document.getElementsByTagName("div"),n=0,a=t.length;n<a;n++)set_ele(t[n])};